import React from 'react';
import { useAuth } from '../contexts/AuthContext';
import { Container, Nav, Navbar as BootstrapNavbar } from 'react-bootstrap';

const Navbar = () => {
  const { agent, logout } = useAuth();

  return (
    <BootstrapNavbar bg="white" expand="lg" className="shadow-sm mb-4">
      <Container>
        <BootstrapNavbar.Brand href="/" className="fw-bold text-primary">
          üè† Airbnb Properties
        </BootstrapNavbar.Brand>

        <BootstrapNavbar.Toggle aria-controls="basic-navbar-nav" />
        <BootstrapNavbar.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto">
            <Nav.Link href="/" className="me-3">Properties</Nav.Link>
            <Nav.Link href="/dashboard" className="me-3">Dashboard</Nav.Link>

            {agent && (
              <div className="d-flex align-items-center">
                <span className="me-3 text-muted">
                  Welcome, {agent.name}
                </span>
                <Nav.Link 
                  onClick={logout} 
                  className="btn btn-outline-danger btn-sm"
                >
                  Logout
                </Nav.Link>
              </div>
            )}
          </Nav>
        </BootstrapNavbar.Collapse>
      </Container>
    </BootstrapNavbar>
  );
};

export default Navbar;
